import React from "react";
import Item from "../Item";
import "./index.css";

export default function List(props) {
  const { todos, deleteTodo, getTrueOrFalse } = props;
  return (
    <div className="list">
      {todos.map((todo) => (
        <Item
          key={todo.id}
          id={todo.id}
          name={todo.name}
          done={todo.done}
          deleteTodo={deleteTodo}
          getTrueOrFalse={getTrueOrFalse}
        />
      ))}
    </div>
  );
}

